import React from 'react';
import ReactDOM from 'react-dom';
import youtube, {programmer, myname} from './App';
ReactDOM.render(
<>

<ol> 
<li>  Sonu </li>
<li> {youtube} </li>
<li>{programmer}</li>
<li>{myname()}</li>
</ol>

</>,
document.getElementById('root')
);
